import './NotPlayable.css'
import PropTypes from 'prop-types'

const NotPlayable = ({ card }, {mat}) => {
    const [isOpen, setIsOpen] = useState(false)

    const cardIsPlayable = () => {
        return false
    }


    return (
        <div className="not_playable">
            {card}
        </div>
    )
}

NotPlayable.propTypes = {
    NotPlayable: PropTypes.oneOfType([
        PropTypes.number,
        PropTypes.oneOf([' '])
    ]).isRequired
};

export default NotPlayable;
